function weighting(clothes, occasion, temp) {
    if(clothes.Occasion == "No") 
        return 1;
    else
        return 1 / ((Math.pow(Math.abs(occasion - clothes.Occasion) * Math.abs(temp - clothes.Temperature)) + 1), 2);
}

function guess(o, occasion, temp) {
//    var shirt = Math.round(Math.random * closet.shirts.length);
//    var sweater = Math.round(Math.random * closet.sweater.length);
//    var outerwear = Math.round(Math.random * closet.outerwear.length);
//    var pants = Math.round(Math.random * closet.pants.length);
//    var shoes = Math.round(Math.random * closet.pants.length);
//    
    var outfit = {};
    
    var sum = {};
    var weight = {};

    for(var p in o){
        sum[p] = 0;
        for(i of o[p]) {
            sum[p] += weighting(i, occasion, temp);
        }
    }
    
    var searching = true;
    var count = 0;
    
    for(var p in o) {
        var target = Math.random() * sum[p];
        count = 0;
        searching = true;
        for(i = 0; i < o[p].length; i++) {
            count += weighting(o[p][i], occasion, temp);
            if(count > target && searching) {
                searching = false;
                outfit[p] = o[p][i];
                //console.log(o[p][i]);
            }
        }
    }
   
    var outfit = JSON.parse("{" + printSrc(outfit.outerwear) + printSrc(outfit.sweater) + printSrc(outfit.shirts) + printSrc(outfit.pants) +  printSrc(outfit.shoes) + '"0": "0"}');
   return(outfit);
}
var printSrc = function(o){
   var str='';

   for(var p in o){
       if(typeof o[p] == 'string'){
           str+= '"' + srcKey[o["Type"]] + p + '"' + ': ' + '"'  + o[p] + '"' +',';
       }else{
           str+= p + ': { </br>' + print(o[p]) + '}';
       }
   }

   return str;
}

var srcKey = {
   "Outerwear": "1_",
   "Sweater": "2_",
   "Shirt": "3_",
   "Pants": "4_",
   "Shoes": "5_"
}

var print = function(o){
   var str='';

   for(var p in o){
       if(typeof o[p] == 'string'){
           str+= p + ': ' + o[p]+'; </br>';
       }else{
           str+= p + ': { </br>' + print(o[p]) + '}';
       }
   }

   return str;
};

    
